import React from "react";
import Header from "./components/Header";
import Image from "./components/Image";
import logo from "./img/JKDunkey.jpg";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      HELP_TEXT: "Help Text",
    }
  }

  render() {
    return (
      <div className="name">
        <Header title="Header" />
        <h1>{this.state.HELP_TEXT}</h1>
        <input
          placeholder={this.state.HELP_TEXT}
          onClick={this.inputClick}
          onMouseEnter={this.mouseHover}
        />
        <p>{this.state.HELP_TEXT === "Help Text" ? "Yes" : "No"}</p>
        <Image image={logo} />
      </div>
    );
  }

  inputClick = () => {
    this.state.HELP_TEXT = "Changed";
    console.log("click");
  };
  mouseHover = () => console.log("mouse");
}

export default App;
